.container {
  overflow: hidden;
  vertical-align: top;
  outline: none;
  display: inline-block;
  white-space: nowrap;
  background-color: #fff;
  position: relative;
  user-select: none;
  -webkit-user-select: none;
  -ms-user-select: none;
  -moz-user-select: none;
}
.container > *:not(.dropdown) {
  height: 100%;
  display: flex;
  align-items: center;
}
.border {
  border-style: solid;
  border-width: 1px;
}
/* 标题文本 */
.label {
  float: left;
  padding: 0 6px;
  border-right-style: solid;
  border-right-width: 0px;
  white-space: nowrap;
}
/* 日期时间容器 */
.datatime {
  padding: 0 8px;
  font-size: 13px;
  white-space: nowrap;
  overflow: hidden;
  cursor: pointer;
}
.datatime > * {
  text-align: center;
  float: left;
}
.text {
  white-space: nowrap;
  cursor: pointer;
}
.text:hover {
  text-decoration: underline;
}
.clear {
  float: right;
  width: 18px;
  line-height: 0;
  font-size: 16px;
  cursor: pointer;
  /* padding-right: 5px; */
  margin-left: -5px;
}
/* 必填 */
.required {
  float: right;
  padding: 0 2px;
  color: #f00;
}
/* 禁止操作 */
.disabled {
  position: absolute;
  width: 100%;
  height: 100%;
  left: 0;
  top: 0;
  background-color: rgba(255, 255, 255, 0.6);
  opacity: 0.6;
  filter: alpha(opacity=60);
  cursor: not-allowed;
}
.daydisplay{
  background-color: rgba(255, 255, 255, 0.6);
  opacity: 0.6;
  filter: alpha(opacity=60);
  cursor: not-allowed!important;
}
.dropdown {
  position: fixed;
  padding: 5px;
  margin: 0;
  background-color: #fff;
  border-width: 1px;
  border-style: solid;
  overflow: visible!important;
  box-shadow: 0px 0px 5px 0px RGBA(0, 0, 0, 0.2);
}
.dropdown span:first-child {
  line-height: 22px;
  margin: -5px -5px 5px -5px;
  float: left;
  text-align: center;
  color: #fff;
}
.drop_item {
  line-height: 26px;
  float: left;
  text-align: center;
  cursor: pointer;
}
.drop_item:hover {
  background-color: var(--list_hover_color);
}
.arrow {
  cursor: pointer;
  font-size: 18px;
}
.arrow:hover {
  font-weight: bold;
}
.quickbtn {
  padding: 0 2px;
}
.quickbtn:hover {
  font-weight: bold;
}
